import React, { useState, useEffect, useCallback } from "react";
import axios from "axios";

const UserList = () => {
  const [users, setUsers] = useState([]);
  const [page, setPage] = useState(1);
  const itemsPerPage = 10;

  const getUsers = useCallback(async () => {
    try {
      const response = await axios.get("http://localhost:5000/users", {
        params: { page, limit: itemsPerPage },
      });
      setUsers(response.data);
    } catch (error) {
      console.log(error);
    }
  }, [page]); // Add page to the dependency array

  useEffect(() => {
    getUsers();

    const interval = setInterval(() => {
      getUsers();
    }, 5000);

    return () => clearInterval(interval);
  }, [getUsers]);

  const deleteUser = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/users/${id}`);
      getUsers();
    } catch (error) {
      console.log(error);
    }
  };

  const handleNextPage = () => {
    setPage((prevPage) => prevPage + 1);
  };

  const handlePreviousPage = () => {
    setPage((prevPage) => prevPage - 1);
  };

  // Calculate the range of items to display in the table
  const startIdx = (page - 1) * itemsPerPage;
  const endIdx = startIdx + itemsPerPage;

  return (
    <div className="columns mt-5">
      <div className="column is-half">
        <table className="table is-striped is-fullwidth mt-2">
          <thead>
            <tr>
              <th>No</th>
              <th>Sumber</th>
              <th>Timestamp</th>
              <th>App_name</th>
              <th>Pengukuran</th>
              <th>Value</th>
              <th>Unit</th>
              <th>Satuan</th>
              <th>Status</th>
              <th>status_reading</th>
            </tr>
            </thead>
          <tbody>
            {users.slice(startIdx, endIdx).map((user, index) => (
              <tr key={user._id}>
                <td>{startIdx + index + 1}</td>
                <td>{index + 1}</td>
                <td>{user.sumber}</td>
                <td>{user.timestamp}</td>
                <td>{user.app_name}</td>
                <td>{user.pengukuran}</td>
                <td>{user.value}</td>
                <td>{user.unit}</td>
                <td>{user.satuan}</td>
                <td>{user.status}</td>
                <td>{user.status_reading}</td>
                <td>
                  <button
                    onClick={() => deleteUser(user._id)}
                    className="button is-danger is-small"
                  >
                    Delete
                  </button>
                </td>
                </tr>
            ))}
          </tbody>
        </table>
        {users.length > itemsPerPage && (
          <div className="mt-4">
            <button
              onClick={handlePreviousPage}
              className="button is-primary is-small"
              disabled={page === 1}
            >
              Previous
            </button>{" "}
            <button
              onClick={handleNextPage}
              className="button is-primary is-small"
              disabled={endIdx >= users.length}
            >
              Next
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default UserList;
